import React from "react";
import styled from "styled-components";

const SearchDivStyle = styled.div`
  display: flex;
  & input {
    color: #fff;
    background-color: #000;
    outline: none;
  }
`;

const SearchBar = () => {
  return (
    <SearchDivStyle>
      <input type="text" />
    </SearchDivStyle>
  );
};

export default SearchBar;
